import React, { useState } from 'react';
import './index.less'

const OrderConfirm = () => {

  const [flag, setFlag] = useState(false)

  const courseInfo = {
    courseName: '',
    amount: 1
  }

  const ImgUrl = 'https://img.kaikeba.com'

  const getRightsList:any[] = [{
    code: 1,
    rightsRemark: '8折',
    rightsName: '高手Club权益',
    rightsNum: 0.01
  }]

  const currentItem = {
    code: 1
  }

  const handleDiscount = (item: any) => {
    console.log(item, 'item')
  }

  return (
    <div className="order-confirm-wrapper">
      {/* 商品信息 */}
      <div className="class-info">
        <p className="head-title">商品信息</p>
        <div className="class-detail">
          <p>课程名称：{courseInfo?.courseName}</p>
          <p>
            商品金额：<span className="course-amount">{courseInfo?.amount}</span>元
          </p>
        </div>
      </div>
      {/* 折扣权益 */}
      <div className="discount-rights">
        <p className="head-title">使用折扣</p>
        <ul className="rights-list">
          {getRightsList && getRightsList.map(item => (
            <li
              key={item.code}
              onClick={() => handleDiscount(item)}
              className={`container tab ${
                currentItem.code === item?.code && flag ? 'active' : null
              }`}
            >
              <div className="list-left">
                <p className="discout">{item.rightsRemark}</p>
                <span className="line"> </span>
                <div className="list-name">
                  <p>{item.rightsName}</p>
                  {item.rightsNum && <p className="count">权益剩余次数：{item.rightsNum}次</p>}
                </div>
              </div>
              <div className="list-right">
                {
                  <img
                    width="100%"
                    src={
                      currentItem.code === item.code && flag
                        ? `${ImgUrl}/pay-sdk/33717102102202gtej.png`
                        : `${ImgUrl}/pay-sdk/85817102102202wssg.png`
                    }
                  />
                }
              </div>
            </li>
          ))}
        </ul>
        <p className="warn-text">提示：同时至多可使用1项折扣</p>
      </div>
    </div>
  )
}

export default OrderConfirm
